query GetLabels($modelId: ID!, $includeDisabled: Boolean!) {
  model(id: $modelId) {
    id
    labels(includeDisabled: $includeDisabled) {
      ...LabelDetails
      __typename
    }
    __typename
  }
}

fragment LabelDetails on Label {
  id
  position {
    x
    y
    z
    __typename
  }
  floor {
    id
    meshId
    __typename
  }
  room {
    id
    meshId
    __typename
  }
  label
  enabled
  created
  modified
  __typename
}
